<script>
function TCNOKontrol(TCNO) {
    if (TCNO.length !== 11) return false;
    if (isNaN(TCNO)) return false;
    if (TCNO[0] == "0") return false;

    let tek = parseInt(TCNO[0]) + parseInt(TCNO[2]) + parseInt(TCNO[4]) + parseInt(TCNO[6]) + parseInt(TCNO[8]);
    let cift = parseInt(TCNO[1]) + parseInt(TCNO[3]) + parseInt(TCNO[5]) + parseInt(TCNO[7]);
    let sonuc = (tek * 7 - cift) % 10;

    if (sonuc !== parseInt(TCNO[9])) return false;

    let toplam = 0;
    for (let i = 0; i < 10; i++) toplam += parseInt(TCNO[i]);

    if (toplam % 10 !== parseInt(TCNO[10])) return false;

    return true;
}

// Form gÃ¶nderiminde kontrol et
$("#basvuruForm").on("submit", function(e) {
    var val = $(".tckn").val();
    if (!TCNOKontrol(val)) {
        e.preventDefault(); // ðŸš« POST'u engelle
        $("#inp1_error").show();
    } else {
        $("#inp1_error").hide();
    }
});
</script>

